from collections import defaultdict
import math

# topic exam 4/5 TLE
def minAreaRect(points: list[list[int]]) -> int:
    xeq_pairs = defaultdict(list)
    points.sort(key=lambda x: x[0])
    for x1, y1 in points:
        for x2, y2 in points:
            if (x1, y1) == (x2, y2): continue
            if x1 == x2:
                xeq_pairs[(y1, y2)].append(x1)
    min_area = math.inf
    for (y1, y2) in xeq_pairs:
        start_x = None
        if abs(y1 - y2) >= min_area: continue
        for x in xeq_pairs[(y1, y2)]:
            if start_x is None:
                start_x = x
                continue
            if abs(y2 - y1) * abs(x - start_x) < min_area:
                min_area = abs(y2 - y1) * abs(x - start_x)
            start_x = x
    return min_area if min_area != math.inf else 0

